import SubTitle from "../../../UI/SubTitle/SubTitle";
import InputCheckbox from "../../../UI/InputCheckbox/InputCheckbox";

import style from "./SearchOption.module.css";

function SearchOption() {
  return (
    <div className={style.searchOption}>
      <SubTitle>search by</SubTitle>
      <div>
        <InputCheckbox label="price" id="price" defaultChecked={false} />
        <div>
          <InputCheckbox
            label="0 ~ $100"
            id="0 ~ $100"
            defaultChecked={false}
          />
          <InputCheckbox
            label="$100 ~ $200"
            id="$100 ~ $200"
            defaultChecked={false}
          />
          <InputCheckbox
            label="$200 ~ $300"
            id="$200 ~ $300"
            defaultChecked={false}
          />
          <InputCheckbox
            label="$300 ~ $400"
            id="$300 ~ $400"
            defaultChecked={false}
          />
          <InputCheckbox
            label="$400 ~ $500"
            id="$400 ~ $500"
            defaultChecked={false}
          />
        </div>
      </div>
      <div>
        <div>category</div>
        <div className={style["checkbox__container"]}>
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="food"
            label="Food"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="transportation"
            label="Transportation"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="clothing"
            label="Clothing"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="entertainment"
            label="Entertainment"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="housing"
            label="Housing"
            defaultChecked={true}
          />
          <InputCheckbox
            classContainer={style["input__container"]}
            classCheck={style.check}
            classInput={style.input}
            classLabel={style.label}
            id="others"
            label="Others"
            defaultChecked={true}
          />
        </div>
      </div>
    </div>
  );
}

export default SearchOption;
